import { useLocation } from "react-router-dom";
export default function EditProfile()
{
    const { state } = useLocation();
    const cabAgencyDetail = state ? state.cabAgencyDetail : null;
    return(
        <div>
            <h1>{cabAgencyDetail.cabAgencyId}</h1>
        </div>
    )
}
